CREATE TABLE IF NOT EXISTS `wordpress`.`wpf0_frmt_form_entry_meta`(
    `meta_id` bigint unsigned NOT NULL AUTO_INCREMENT,
    `entry_id` bigint unsigned NOT NULL,
    `meta_key` varchar(191) NULL,
    `meta_value` longtext NULL,
    `date_created` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
    `date_updated` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
    PRIMARY KEY  (`meta_id` ),
    KEY `meta_key` (`meta_key` ),
    KEY `meta_entry_id` (`entry_id` ),
    KEY `meta_key_object` (`entry_id` ,`meta_key` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci ;
